import React from 'react'
import './Footer.css'
import LanguageIcon from '@mui/icons-material/Language';
import EmailIcon from '@mui/icons-material/Email';

function Footer() {
  return (
    <div className='footer'>
        <div className='text'>
        <LanguageIcon/>
        <h5>www.eyerov.com <br></br></h5>
        
        <EmailIcon/>
        <h5>info@eyerov.com</h5>
        <div className='info'>
            <h5>@2021 EyeROV (IROV Technologies Pvt. Ltd.)</h5>
        </div>
        </div>
        
    </div>
  )
}

export default Footer
